USE [master]
GO

/*******************************************************************************
   Drop database if it exists
********************************************************************************/
IF EXISTS (SELECT name FROM master.dbo.sysdatabases WHERE name = N'PE_DBI202_F2021')
BEGIN
	ALTER DATABASE [PE_DBI202_F2021] SET OFFLINE WITH ROLLBACK IMMEDIATE;
	ALTER DATABASE [PE_DBI202_F2021] SET ONLINE;
	DROP DATABASE [PE_DBI202_F2021];
END

GO

CREATE DATABASE [PE_DBI202_F2021]
GO

USE [PE_DBI202_F2021]
GO

/*******************************************************************************
	Drop tables if exists
*******************************************************************************/
DECLARE @sql nvarchar(MAX) 
SET @sql = N'' 

SELECT @sql = @sql + N'ALTER TABLE ' + QUOTENAME(KCU1.TABLE_SCHEMA) 
    + N'.' + QUOTENAME(KCU1.TABLE_NAME) 
    + N' DROP CONSTRAINT ' -- + QUOTENAME(rc.CONSTRAINT_SCHEMA)  + N'.'  -- not in MS-SQL
    + QUOTENAME(rc.CONSTRAINT_NAME) + N'; ' + CHAR(13) + CHAR(10) 
FROM INFORMATION_SCHEMA.REFERENTIAL_CONSTRAINTS AS RC 

INNER JOIN INFORMATION_SCHEMA.KEY_COLUMN_USAGE AS KCU1 
    ON KCU1.CONSTRAINT_CATALOG = RC.CONSTRAINT_CATALOG  
    AND KCU1.CONSTRAINT_SCHEMA = RC.CONSTRAINT_SCHEMA 
    AND KCU1.CONSTRAINT_NAME = RC.CONSTRAINT_NAME 

EXECUTE(@sql) 

GO
DECLARE @sql2 NVARCHAR(max)=''

SELECT @sql2 += ' Drop table ' + QUOTENAME(TABLE_SCHEMA) + '.'+ QUOTENAME(TABLE_NAME) + '; '
FROM   INFORMATION_SCHEMA.TABLES
WHERE  TABLE_TYPE = 'BASE TABLE'

Exec Sp_executesql @sql2 
GO 

CREATE TABLE [ProductModel](
	[ModelID] [int] NOT NULL primary key,
	[Name] nvarchar(100) NOT NULL
)
GO

CREATE TABLE [ProductSubcategory](
	[SubcategoryID] [int] NOT NULL primary key,
	[Category] nvarchar(100),
	[Name] nvarchar(100) NOT NULL
)
GO

CREATE TABLE [Product](
	[ProductID] [int] NOT NULL primary key,
	[Name] nvarchar(200) NOT NULL,
	[Color] nvarchar(15) NULL,
	[Cost] [money] NOT NULL,
	[Price] [money] NOT NULL,
	[SubcategoryID] [int] NULL references ProductSubcategory(SubcategoryID),
	[ModelID] [int] NULL references ProductModel(ModelID),
	[SellStartDate] [datetime] NOT NULL,
	[SellEndDate] [datetime] NULL
)
GO

CREATE TABLE [Location](
	[LocationID] [smallint] NOT NULL primary key,
	[Name] nvarchar(200) NOT NULL,
	[CostRate] [smallmoney] NOT NULL,
	[Availability] [decimal](8, 2) NOT NULL
)
GO

CREATE TABLE [ProductInventory](
	[ProductID] [int] references Product(ProductID),
	[LocationID] [smallint] references Location(LocationID),
	[Shelf] [nvarchar](10) NOT NULL,
	[Bin] [tinyint] NOT NULL,
	[Quantity] [smallint] NOT NULL,
	primary key (ProductID, LocationID)
)
GO

CREATE TABLE [ProductCostHistory](
	[ProductID] [int] NOT NULL references Product(ProductID),
	[StartDate] [datetime] NOT NULL,
	[EndDate] [datetime] NULL,
	[Cost] [money] NOT NULL,
	primary key (ProductID, StartDate)
)
GO

CREATE TABLE [ProductPriceHistory](
	[ProductID] [int] NOT NULL references Product(ProductID),
	[StartDate] [datetime] NOT NULL,
	[EndDate] [datetime] NULL,
	[Price] [money] NOT NULL,
	primary key ([ProductID], StartDate)
)
GO
